    ledShow(args) {
        const parameters = JSON.stringify({ r: args.RED, g: args.GREEN, b: args.BLUE });
        return this.getMqttMessage('led.show', parameters);
    }

    ledSetRed(args) {
        const parameters = JSON.stringify({ val: args.VALUE });
        return this.getMqttMessage('led.set_red', parameters);
    }

    ledSetGreen(args) {
        const parameters = JSON.stringify({ val: args.VALUE });
        return this.getMqttMessage('led.set_green', parameters);
    }

